import { NavLink } from 'react-router-dom';
import s from './Navbar.module.css';


const Navbar = () => {
    return (
        <nav className={ s.nav }>
            <ul >
                <li className={ s.item }>
                    <NavLink to="/profile" className={({ isActive }) => `${s.link} ${(isActive ? `${s.activeLink}` : "")}`}>Profile</NavLink>
                </li>
                <li className={ s.item }>
                    <NavLink className={ s.link } to="/dialogs">Messages</NavLink>
                </li>
                <li className={ s.item }>
                    <NavLink className={ s.link } to="/news">News</NavLink>
                </li>
                <li className={ s.item }>
                    <NavLink className={ s.link } to="/music">Music</NavLink>
                </li>
                <li className={ s.item }>
                    <NavLink className={ s.link } to="/settings">Settings</NavLink>
                </li>
            </ul>
        </nav>
    )
}

export default Navbar;

